import React from "react";
import { NavLink } from "react-router-dom";

class Header extends React.Component {
  render() {
    return (
      <header>

        <img path="/logo" alt="logo" class="logo-image"></img>

        <nav classname="menu">
          <ul>
            <li>
              <NavLink to="/" exact activeClassName="active">Home</NavLink>
            </li>

            <li>
              <NavLink to="/Weather" exact activeClassName="active">VÃ¤der</NavLink>
            </li>

            <li>
              <NavLink to="/Tours" exact activeClassName="active">Tours</NavLink>
            </li>

            <li>
              <NavLink to="/Login" exact activeClassName="active">Logga in</NavLink>
            </li>

          </ul>
        </nav>

      </header>
    );
  }
}

export default Header;
